window.bookSummaryJSON = "<p>On the day I was married, I promised to love, honor, and obey my husband, Stefan.<br> Little did I know how literally I would mean obeying.<br> Stefan tells me what to do, and I do it. There are questions asked, but I always submit in the end.<br> It would hurt less if I hadn't started falling for him.<br> It was supposed to be pretend. But the secrets we now share are too real, and they're crumbling every piece of who I thought I was.<br> If only Stefan was the man I thought he was.<br> If only I weren't so powerless.<br> But there's one thing I have that he wants.<br> My body.<br> And I'll do anything it takes to right the wrongs I've discovered.</p> <p><b>Book two in the Arranged Trilogy</b></p>"; 
